import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './components/Home';


function App() {
  return (
    <BrowserRouter>
    <div className="App">
    <Switch>
      <h1>productos ecologicos</h1>
      
        <Route path="/home" element={<Home />} />
      </Switch>
      </div>
      </BrowserRouter>
  );
}

export default App;
